import pyperclip

class CreateJson:
    def get_data(self):
        """
        @summary: 从控制台读取多行
        ---------
        ---------
        @result:
        """
        input("请复制需要转换的内容（xxx:xxx格式，支持多行），复制后按任意键读取剪切板内容\n")

        text = pyperclip.paste()
        print(text + "\n")

        data = []
        for line in text.split("\n"):
            line = line.strip().replace("\t", " " * 4)
            if not line:
                break

            data.append(line)

        return data

